timeline.message:
Swagger validation complains that several API operations have multiple body parameters because Parametsr are not annotated correctly

looking at the Group Resource Update Roster Method, we se:e that none of the Parameters to the method was annotated with @ApiParam

public Group updateRoster(@ApiParam(value = "Attribution roster ID") @PathParam("rosterID") UUID rosterID,
@Valid @Profiled(profile = AttestationProfile.PROFILE_URI)
@ProvenanceHeader Provenance rosterAttestation,
Group rosterUpdate) {....

so we can change like this

public Group updateRoster(@ApiParam(value = "Attribution roster ID") @PathParam("rosterID") UUID rosterID,
@Valid @Profiled(profile = AttestationProfile.PROFILE_URI)
@ProvenanceHeader Provenance rosterAttestation,
@ApiParam Group rosterUpdate) {....

This may require additional annotations on the Provenance rosterAttestation parameters, but we should try the minimal additions first.

